// images.fromBytes(bytes)
// bytes {byte[]} 字节数组
// 解码字节数组bytes并返回解码后的图片Image对象。如果bytes无法解码则返回null。
var res = http.get("https://cdnstatic.hunteron.com/c/home/images/act/jobTopic57@3x.jpg")
var b = res.body.bytes()
var img = images.fromBytes(b)
img.saveTo('/sdcard/脚本/fromBytes.jpg')
img.recycle()